import './assets/css/style.css';


import MenuTop from './layouts/menutop';
import MenuBox from './layouts/menubox';

const Layout=()=>
    {
        return (
            <body>
                <header>
                    <MenuTop/>

                    <div><MenuBox/></div>
                    
                </header>

    

            </body>
        
        );
    };

export default Layout;
